// CallInsights.jsx
import React, { useState, useEffect } from 'react';
import './call_insights.css';

const CallInsights = () => {
  // State to hold the Python output data (JSON)
  const [data, setData] = useState(null);
  const [activeAccordion, setActiveAccordion] = useState(null);

  useEffect(() => {
    // Fetch JSON output from your backend API
    fetch('http://localhost:5001/api/output')
      .then(res => res.json())
      .then(json => setData(json))
      .catch(err => console.error('Error fetching data:', err));
  }, []);

  const toggleAccordion = (index) => {
    setActiveAccordion(activeAccordion === index ? null : index);
  };

  if (!data) {
    return (
      <div className="container">
        <div className="loading" style={{ textAlign: 'center', padding: '50px', fontSize: '1.2rem' }}>
          Loading...
        </div>
      </div>
    );
  }

  // Parse the detailed analysis into sections
  const analysisContent = data.custom_rag_analysis.output;
  const analysisSections = [
    {
      title: "Sales Call Analysis",
      content: analysisContent.split("Matching Benchmark")[0].trim()
    },
    {
      title: "Matching Analysis",
      content: "Matching Benchmark: " + analysisContent.split("Matching Benchmark:")[1].split("Detailed Analysis:")[0].trim()
    },
    {
      title: "Detailed Feedback",
      content: analysisContent.split("Detailed Analysis:")[1].split("**Conversational Balance**")[0].trim()
    },
    {
      title: "Conversational Balance",
      content: "**Conversational Balance**" + analysisContent.split("**Conversational Balance**")[1].split("**Objection Handling**")[0].trim()
    },
    {
      title: "Objection Handling",
      content: "**Objection Handling**" + analysisContent.split("**Objection Handling**")[1].split("**Pitch Optimization**")[0].trim()
    },
    {
      title: "Pitch Optimization",
      content: "**Pitch Optimization**" + analysisContent.split("**Pitch Optimization**")[1].split("**Call-to-Action Execution**")[0].trim()
    },
    {
      title: "Call-to-Action Execution",
      content: "**Call-to-Action Execution**" + analysisContent.split("**Call-to-Action Execution**")[1].trim()
    }
  ];

  return (
    <div className="container">
      {/* TOP BAR */}
      <div className="top-bar">
        <div className="logo">Call Insights</div>
      </div>

      {/* CONTENT WRAPPER */}
      <div className="content">
        {/* SIDEBAR */}
        <div className="sidebar">
          <h2>Call Rating</h2>
          <div className="match-rate-circle" data-percentage="85">
            <span className="percentage">85%</span>
          </div>
          <div className="sidebar-section">
            <h4>Buyer Intent</h4>
            <p>
              <strong>Predicted:</strong>{' '}
              <span style={{ color: 'green' }}>
                {data.buyer_intent.output.trim()}
              </span>
            </p>
          </div>
          <div className="sidebar-section">
            <h4>Profanity Detection</h4>
            <p>
              <strong>Severity Level:</strong>{' '}
              {data.profanity_check.output.trim().includes("Clean") ? "Clean" : data.profanity_check.output.trim()}
            </p>
          </div>
        </div>

        {/* MAIN SECTION */}
        <div className="main-section">
          <div className="section-card">
            <h3>Call Summary</h3>
            <div style={{ whiteSpace: 'pre-wrap' }}>
              {data.call_summary.output}
            </div>
          </div>

          <h3>Detailed Analysis</h3>
          <div className="accordion">
            {analysisSections.map((section, index) => (
              <div className="accordion-item" key={index}>
                <div 
                  className={`accordion-header ${activeAccordion === index ? 'active' : ''}`}
                  onClick={() => toggleAccordion(index)}
                >
                  {section.title}
                </div>
                <div className={`accordion-content ${activeAccordion === index ? 'show' : ''}`}>
                  <div style={{ whiteSpace: 'pre-wrap' }}>
                    {section.content}
                  </div>
                </div>
              </div>
            ))}
          </div>

          <div className="footer-actions">
            <button>Download Report</button>
            <button>Share Insights</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CallInsights;
